/*Table structure for table `GAME_OPEN_LOG` */

DROP TABLE IF EXISTS `GAME_OPEN_LOG`;

CREATE TABLE `GAME_OPEN_LOG` (
  `ID` int(11) NOT NULL AUTO_INCREMENT,
  `USER_ID` int(11) DEFAULT NULL,
  `GAME_TYPE` int(11) DEFAULT NULL COMMENT '1北京快乐8 2加拿大快乐8',
  `OPEN_TIME` datetime DEFAULT NULL COMMENT '开奖日期',
  `GAME_NUM` varchar(30) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '开奖期数',
  `GAME_RESULT` int(11) DEFAULT NULL COMMENT '开奖结果 （数字）',
  `GAME_RESULT_DESC` varchar(100) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '开奖结果 （含式子）',
  `RESULT_TYPE` varchar(30) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '开奖类型',
  `IS_BAOZI` int(1) DEFAULT '0' COMMENT '是否豹子',
  `XHIBIT_POINT` double(9,2) DEFAULT '0.00' COMMENT '积分亏盈',
  `TOTAL_POINT` double(9,2) DEFAULT '0.00' COMMENT '总积分',
  `IS_GIVE` int(1) DEFAULT '0' COMMENT '是否派奖',
  `GIVE_POINT` double(9,2) DEFAULT '0.00' COMMENT '派发总积分',
  `COLOR` int(1) DEFAULT NULL COMMENT '1红 2绿 3蓝 4无',
  `SOURCE` int(11) DEFAULT NULL,
  PRIMARY KEY (`ID`)
