DROP TABLE IF EXISTS `GIFT_INFO`;

CREATE TABLE `GIFT_INFO` (
  `ID` int(11) NOT NULL AUTO_INCREMENT,
  `GIFT_NAME` varchar(100) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '礼物',
  `GIFT_POINT` double(9,2) DEFAULT NULL COMMENT '所需金额',
