/*Table structure for table `MANAGER` */

DROP TABLE IF EXISTS `MANAGER`;

CREATE TABLE `MANAGER` (
  `ID` smallint(6) NOT NULL AUTO_INCREMENT COMMENT 'ID',
  `name` varchar(50) DEFAULT NULL COMMENT '账号',
  `passwd` varchar(20) DEFAULT NULL COMMENT '密码',
  `type` varchar(32) DEFAULT 'normal' COMMENT '管理员类型\n            super:超级管理员\n            normal:普通管理员',
  `STATUS` smallint(6) DEFAULT NULL COMMENT '是否有效',
  `create_time` datetime DEFAULT NULL COMMENT '创建时间',
  `update_time` datetime DEFAULT NULL COMMENT '修改时间',
  `LOGIN_TIME` datetime DEFAULT NULL COMMENT '登入时间',
  `PARENT_ID` int(11) DEFAULT NULL,
  PRIMARY KEY (`ID`),
  UNIQUE KEY `manager_name` (`name`)
) ENGINE=InnoDB AUTO_INCREMENT=80 DEFAULT CHARSET=utf8;

