insert  into `QUEST_INFO`(`ID`,`TITLE`,`CONTENT`,`CREATE_TIME`) values (1,'最新优惠','最新优惠\n     线下充值有惊喜！每日元宝送不停！\n活动规则：会员使用先下银行卡转账充值，每日首次充值1000以上可获赠3%元宝，第二次期每次均多赠送1.2%\n活动时间：即日起-2017/03/31  \n\n24小时在线客服微信：klcp28',NULL),(2,'充值问题','充值问题\n    您好！入款有以下两种方式：\nA.线上支付（推荐使用）\n支持:微信，支付宝，银行卡，支付安全便捷，付款成功后可实时到账\n\nB.线下支付\n微信转账：添加客服微信进行转账，支付成功后提交订单\n支付宝转账:支付宝转账成功后提交支付订单\n银行卡转账:选择银行卡号转账成功后提交支付订单\n\n（每日首次充值一千以上赠送3%）',NULL),(3,'提现问题','点击我的钱包→提现→设置提现密码→绑定银行卡→确认提现订单完成！\n（提现1~30分钟到帐，如银行系统维护，到帐具体时间以游戏公告为准）',NULL),(4,'赔率问题','赔率问题\n幸运28 （2分）    加拿大28（3.5分）\n初级房  \n大小单双：连本带利：100赔200\n小单大双：连本带利：100赔460\n小双大单：连本带利：100赔420\n\n注：初级房遇开13/14赔率为1倍\n\n中级房\n大小单双：连本带利：100赔200\n小单大双：连本带利：100赔400\n小双大单：连本带利：100赔400\n\n注：中级房遇开13/14 大小单双赔率为1.5倍，组合赔率2.5倍\n\n高级房\n大小单双：连本带利：100赔200\n小单大双：连本带利：100赔400\n小双大单：连本带利：100赔400\n\n注：高级房遇开13/14 大小单双赔率为1.5倍，组合赔率2.5倍',NULL),(5,'玩法介绍','幸运28 （新版）开奖计算规则：\n\n1.将当期第三方开奖数据从小到大进行排序。\n2.排序后,分别按号码第 (2,5,8,11,14,17) , (3,6,9,12,15,18) , (4,7,10,13,16,19) 数字位分为【1】【2】【3】三个区。\n3.把每个区的数字分别相加。\n4.分别取每个区的和值尾数进行相加,即为新加坡28的当期开奖结果。\n\n全天开奖期数：【660期】\n2分钟为一期 每天停售时间 凌晨06:00~08:00\n\n\n加拿大28（新版）开奖计算规则：\n\n1.将当期第三方开奖数据从小到大进行排序。\n2.排序后,分别按号码第 (2,5,8,11,14,17) , (3,6,9,12,15,18) , (4,7,10,13,16,19) 数字位分为【1】【2】【3】三个区。\n3.把每个区的数字分别相加。\n4.分别取每个区的和值尾数进行相加,即为新加坡28的当期开奖结果。\n\n全天开奖期数：【390期】\n3.5分一期  每天停售时间 晚上19:00~20:00',NULL),(6,'关于回水','关于回水\n        初级房：当天亏损↓\n       301~30000 回水 1%\n    30001~100000 回水 2%\n   100001~1000000 回水 3%\n        中级房：当天亏损↓\n       301~30000 回水 5%\n     30001~100000 回水 8%\n   100001~1000000 回水 11%\n         高级房 当天亏损↓\n        301~10000 回水 5%\n      10001~30000 回水 8%\n      30001~50000 回水 10%\n     50001~100000 回水 12%\n    100001~200000 回水 15%\n    200001~1000000 回水 18%',NULL),(7,'代理合作','代理合作\n请咨询微信客服：M99520212',NULL),(8,'账户异常或者忘记密码','账户异常或者忘记密码\n     遇到帐户异常无法登入情况，请及时联系24小时人工客服:\n\n微信：M99520212\nQ Q ：无',NULL),(9,'取消或更改下注','取消或更改下注\n确认下注，即无法取消下注，会员下注前请务必阅读本平台条例。',NULL);

