/*Table structure for table `USER_INFO` */

DROP TABLE IF EXISTS `USER_INFO`;

CREATE TABLE `USER_INFO` (
  `ID` int(11) NOT NULL AUTO_INCREMENT COMMENT 'id=100不能删除',
  `ACCOUNT` varchar(30) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '帐号',
  `PASSWORD` varchar(50) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '密码',
  `USER_PHOTO` varchar(200) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '头像',
  `NICK_NAME` varchar(30) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '昵称',
  `SEX` int(1) DEFAULT '1' COMMENT '性别 1男 2女',
  `MOBILE` varchar(11) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '电话',
  `POINT` double(12,2) DEFAULT '0.00' COMMENT '积分',
  `CREATE_TIME` datetime DEFAULT NULL,
  `BAND_ID` varchar(50) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '绑定识别id （openid）',
  `BAND_TYPE` int(1) DEFAULT '0' COMMENT '绑定类型 0 无绑定 2微信  3qq',
  `REGISTRATION_ID` varchar(30) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '极光设备id（待定）',
  `CODE` varchar(20) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '邀请码（待定）',
  `STATUS` int(1) DEFAULT '1' COMMENT '1正常 0拉黑',
  `IM_ACCOUNT` varchar(100) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT 'IM帐号',
  `LEVEL` int(11) DEFAULT '1' COMMENT '等级',
  `USER_TYPE` int(1) DEFAULT '1' COMMENT '1普通用户 2机器人',
  `LOGIN_TIME` datetime DEFAULT NULL COMMENT '最后登录时间',
  `XHIBIT_POINT` double(9,2) DEFAULT '0.00' COMMENT '积分亏盈',
  `PERSONAL_SIGN` varchar(100) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '个性签名',
  `WITHDRAWALS_PASSWORD` varchar(100) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '提现密码',
  `REAL_NAME` varchar(100) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '开户姓名',
  `BANK_NAME` varchar(100) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '银行名称',
  `BANK_NO` varchar(100) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '银行卡号',
  `OPEN_CARD_ADDRESS` varchar(200) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '开户地址',
  `ALL_POINT` double(10,2) DEFAULT '0.00' COMMENT '总积分',
  `IP_ADDR` varchar(30) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  PRIMARY KEY (`ID`)
) ENGINE=InnoDB AUTO_INCREMENT=160725 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;

