insert  into `WAP_INFO`(`ID`,`WAP_TITLE`,`WAP_CONTENT`,`WAP_KEY`) values (5,'用户协议','<h3>一、服务条款1</h3>\n\n<p>爱沃佳提供的服务将完全按照其发布的使用协议、服务条款和操作规则严格执行。为获得爱沃佳服务，服务使用人（以下称&ldquo;会员&rdquo;）应当同意本协议的全部条款并按照页面上的提示完成全部的注册程序。</p>\n\n<h3>二、目的</h3>\n\n<p>本协议是以规定用户使用爱沃佳提供的服务时，爱沃佳与会员间的权利、义务、服务条款等基本事宜为目的。</p>\n\n<h3>三、遵守法律及法律效力</h3>\n\n<p>本服务使用协议在向会员公告后，开始提供服务或以其他方式向会员提供服务同时产生法律效力。</p>\n\n<p>会员同意遵守《中华人民共和国保密法》、《计算机信息系统国际联网保密管理规定》、《中华人民共和国计算机信息系统安全保护条例》、《计算机信息网 络国际联网安全保护管理办法》、《中华人民共和国计算机信息网络国际联网管理暂行规定》及其实施办法等相关法律法规的任何及所有的规定，并对会员以任何方 式使用服务的任何行为及其结果承担全部责任。</p>\n\n<p>在任何情况下，如果本应用合理地认为会员的任何行为，包括但不限于会员的任何言论和其他行为违反或可能违反上述法律和法规的任何规定，本应用可在任何时候不经任何事先通知终止向会员提供服务。</p>\n\n<p>本应用可能不时的修改本协议的有关条款，一旦条款内容发生变动，本应用将会在相关的页面提示修改内容。在更改此使用服务协议时，本网站将说明更改内容的执行日期，变更理由等。且应同现行的使用服务协议一起，在更改内容发生效力前7日内及发生效力前日向会员公告。</p>','USER_AGREEMENT'),(6,'关于页面','<p>PC蛋蛋是一款国内主打热门游戏，由，北京28，加拿大28，两款游戏。现正式上线。</p>','ABOUT_US'),(8,'推荐有礼','<p align=\"center\"><strong>成功推荐新用户,10元优惠券轻松赚!</strong></p>\n\n<p><strong>规则说明:</strong></p>\n\n<p>凡是通过点击右上角分享按钮推荐身边亲朋好友下载爱沃佳手机APP的用户,新用户在注册的时候输入推荐人的ID(用户名),推荐人即可获得<strong style=\"line-height: 20.8px; text-align: -webkit-center;\">10元优惠券</strong>的奖励.获得的<strong style=\"line-height: 20.8px; text-align: -webkit-center;\">10元优惠券</strong>可以在我们的商城里面兑换各种礼品商品,好礼多多,等你来拿.</p>','TUI_JIAN'),(13,'下载页面','<p>erterterterrr</p>\n','DOWNLOAD'),(14,'名词解释','<div class=\"text\" id=\"u347\">\n<p><span>待</span><span>结算额</span></p>\n\n<p><span>当前</span><span>待</span><span>结算的金额，线上支付的利润收入</span><span>和</span><span>配送</span><span>费</span><span>-进货额-昨日欠款</span><span>，结算后则为0</span></p>\n\n<p>&nbsp;</p>\n</div>\n\n<div class=\"ax_文本段落\" id=\"u348\">\n<div class=\"text\" id=\"u349\">\n<p><span>累计</span><span>总</span><span>收入</span></p>\n\n<p><span>含已结算和待结算的利润收入和配送费，含线上和线下支付的</span><span>交易</span></p>\n\n<div class=\"text\" id=\"u355\">\n<p><span>已结算</span><span>额</span></p>\n\n<p><span>与</span><span>总</span><span>平台结算的货款和利润</span><span>，</span><span>分今日、昨天、本周、本月4个维度统计</span></p>\n</div>\n</div>\n</div>\n\n<div class=\"ax_文本段落\" id=\"u352\">\n<div class=\"text\" id=\"u353\">\n<p><span>进货额</span></p>\n\n<p><span>截止</span><span>今日</span><span>/昨日</span><span>/本周</span><span>/本月</span><span>&nbsp;</span><span>进货的货款总额</span></p>\n\n<div class=\"text\" id=\"u426\">\n<p><span>门店</span><span>收入</span></p>\n\n<p><span>到</span><span>门店</span><span>购买采用</span><span>现金收款和使用线上支付方式的累计</span><span>交易</span><span>收入（利润）</span></p>\n\n<div class=\"text\" id=\"u428\">\n<p><span>线上交易</span></p>\n\n<p><span>线上商城购买的累计交易</span><span>收入（利润）</span></p>\n</div>\n</div>\n</div>\n</div>','JIE_SHI'),(15,'保密协议','<p>111</p>','SECTET_AGREEMENT'),(16,'常见问题','<table style=\"width:730px;\">\n	<tbody>\n		<tr>\n			<td style=\"width:80px;\">\n			<p align=\"justify\"><strong>玩法</strong></p>\n			</td>\n			<td style=\"width:650px;\">\n			<p align=\"justify\"><strong>规则</strong></p>\n			</td>\n		</tr>\n		<tr>\n			<td style=\"width:80px;\">\n			<p align=\"justify\"><strong>特码</strong></p>\n			</td>\n			<td style=\"width:650px;\">\n			<p align=\"justify\"><strong>从0-27中选取一个以上的数字，投注号码与开奖号码和值相同，即中奖</strong></p>\n			</td>\n		</tr>\n		<tr>\n			<td style=\"width:80px;\">\n			<p align=\"justify\"><strong>特码包三</strong></p>\n			</td>\n			<td style=\"width:650px;\">\n			<p align=\"justify\"><strong>从0-27中任选3个号码组成1注，任意一个选号与开奖号码和值相同，即中奖</strong></p>\n			</td>\n		</tr>\n		<tr>\n			<td style=\"width:80px;\">\n			<p align=\"justify\"><strong>大小玩法</strong></p>\n			</td>\n			<td style=\"width:650px;\">\n			<p align=\"justify\"><strong>数字14-27为大 ；</strong><br />\n			<strong>数字0-13为小；</strong><br />\n			<strong>当期开奖号码和值，符合投注组合，即中奖</strong></p>\n			</td>\n		</tr>\n		<tr>\n			<td style=\"width:80px;\">\n			<p align=\"justify\"><strong>单双玩法</strong></p>\n			</td>\n			<td style=\"width:650px;\">\n			<p align=\"justify\"><strong>数字1，3，5，~27为单 ；</strong><br />\n			<strong>数字0，2，4，~26为双；</strong><br />\n			<strong>当期开奖号码和值，符合投注组合，即中奖</strong></p>\n			</td>\n		</tr>\n		<tr>\n			<td style=\"width:80px;\">\n			<p align=\"justify\"><strong>组合玩法</strong></p>\n			</td>\n			<td style=\"width:650px;\">\n			<p align=\"justify\"><strong>从大双,小单,大单,小双中至少选一注，当期开奖号码和值，符合投注组合，即中奖</strong></p>\n			</td>\n		</tr>\n		<tr>\n			<td style=\"width:80px;\">\n			<p align=\"justify\"><strong>极值玩法</strong></p>\n			</td>\n			<td style=\"width:650px;\">\n			<p align=\"justify\"><strong>数字0，1，2，3，4，5为极小 ；</strong><br />\n			<strong>数字22，23，24，25，26，27为极大；</strong><br />\n			<strong>当期开奖号码和值，符合投注组合，即中奖</strong></p>\n			</td>\n		</tr>\n		<tr>\n			<td style=\"width:80px;\">\n			<p align=\"justify\"><strong>波色玩法</strong></p>\n			</td>\n			<td style=\"width:650px;\">\n			<p align=\"justify\"><span style=\"display: none;\">&nbsp;</span><span style=\"color:#008000;\"><strong>绿波1，4，7，10，16，19，22，25；</strong></span><span style=\"display: none;\">&nbsp;</span><br />\n			<span style=\"color:#0000FF;\"><strong>蓝波2，5，8，11，17，20，23，26</strong><strong>；</strong></span><br />\n			<span style=\"color:#FF0000;\"><strong>红波3，6，9，12，15，18，21，24</strong><strong>；</strong></span><br />\n			<strong>当期开奖号码和值，符合投注组合，即中奖</strong></p>\n			</td>\n		</tr>\n		<tr>\n			<td style=\"width:80px;\">\n			<p align=\"justify\"><strong>豹子玩法</strong></p>\n			</td>\n			<td style=\"width:650px;\">\n			<p align=\"justify\"><strong>当期开奖号码三个数字相同即中奖</strong></p>\n			</td>\n		</tr>\n	</tbody>\n</table>','COMMON_PROBLEMS'),(1000000,'用户提现协议','<p>点击我的钱包&rarr;提现&rarr;设置提现密码&rarr;绑定银行卡&rarr;确认提现订单完成！<br />\n（提现1~30分钟到帐，如银行系统维护，到帐具体时间以游戏公告为准）</p>','WITHDRAWALS_AGREEMENT'),(1000001,'初级房赔率说明','<table border=\"1\" cellpadding=\"1\" cellspacing=\"0\" style=\"line-height: 20.8px; width: 640px;\">\n	<tbody>\n		<tr>\n			<td colspan=\"2\" style=\"border-color: rgb(255, 153, 204); background-color: rgb(255, 153, 0);\">\n			<p style=\"margin-left: 80px;\"><span style=\"color:#FF0000;\"><span style=\"font-size: 16px;\"><strong>&nbsp;玩法 &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; 赔率</strong></span></span></p>\n			</td>