/*Table structure for table `WITHDRAWALS_LOGS` */

DROP TABLE IF EXISTS `WITHDRAWALS_LOGS`;

CREATE TABLE `WITHDRAWALS_LOGS` (
  `ID` int(11) NOT NULL AUTO_INCREMENT,
  `USER_ID` int(11) DEFAULT NULL,
  `USER_TYPE` int(1) DEFAULT NULL COMMENT '1 用户',
  `TYPE` int(1) DEFAULT '1' COMMENT '操作类型  1提现',
  `FEE` double(8,2) DEFAULT '0.00' COMMENT '操作金额',
  `BILI` double(8,2) DEFAULT NULL COMMENT '提现比例',
  `REAL_FEE` double(8,2) DEFAULT NULL COMMENT '实到金额',
  `BANK_NAME` varchar(100) DEFAULT NULL COMMENT '银行名 （渠道为3有效）',
  `ACCOUNT` varchar(50) DEFAULT NULL COMMENT '提现帐号',
  `STATUS` int(1) DEFAULT NULL COMMENT '状态 0未处理 1已处理 2处理失败',
  `SOURCE` varchar(30) DEFAULT NULL COMMENT '渠道1支付宝 2微信 3银行卡',
  `CREATE_TIME` datetime DEFAULT NULL COMMENT '创建时间',
  `UPDATE_TIME` datetime DEFAULT NULL,
  `REAL_NAME` varchar(30) DEFAULT NULL COMMENT '用户名',
  `MOBILE` varchar(20) DEFAULT NULL,
  `CREATE_BANK_NAME` varchar(200) DEFAULT NULL,
  PRIMARY KEY (`ID`)
) ENGINE=MyISAM AUTO_INCREMENT=1000215 DEFAULT CHARSET=utf8;

